import React from 'react';
import '../styles/Experience.css'; // Import your CSS styles

export default function Experience() {
  const projects = [
    {
      title: 'Art & Design',
      description: 'An delighted offending curiosity my is dashwoods',
      author: 'Will Lewis',
      time: '4 Years Ago',
      image: '/assets/art-design.png',
      readTime: '2 min',
      comments: 3,
    },
    {
      title: 'Beauty',
      description: 'Indulgence unreserved is the alteration appearance...',
      author: 'Will Lewis',
      time: '4 Years Ago',
      image: '/assets/beauty.png',
      readTime: '2 min',
      comments: 2,
    },
    // Add more projects as needed
  ];

  return (
    <div className="experience-container">
      <h1 className="experience-heading">My Projects</h1>
      <div className="bento-grid">
        {projects.map((project, index) => (
          <div key={index} className="bento-box">
            <div className="bento-image">
              <img src={project.image} alt={project.title} />
            </div>
            <div className="bento-content">
              <span className="category">{project.title}</span>
              <h2 className="project-title">{project.description}</h2>
              <div className="project-meta">
                <p>by {project.author} â€” {project.time}</p>
                <span className="read-time">{project.readTime}</span>
              </div>
              <p className="project-comments">{project.comments} Comments</p>
              <a href="#" className="continue-reading">Continue Reading</a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
